import React from 'react';
import Grid from '@material-ui/core/Grid';

const SecondNavbar = () => {
	return (
		<Grid container direction='row-reverse' style={{ backgroundColor: 'black' }}>
			<Grid item>some</Grid>
		</Grid>
	);
};

export default SecondNavbar;
